import { useNavigate } from "react-router-dom"



const Nav=()=>{
    const navigate=useNavigate()
    const handleLog=()=>{
        localStorage.removeItem("token")
        navigate("/login",{replace:true})
    }

    return(
        <>
        <div>
            <h1>J<span>star</span></h1>
            <button onClick={handleLog}>Logout</button>
        </div>
        </>
    )
}

export default Nav
